import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const ClaimList = () => {
  const [claims, setClaims] = useState([]);

  useEffect(() => {
    axios.get('API_URL', {
      headers: {
        'Authorization': 'Basic YOUR_BASIC_AUTH_TOKEN'
      }
    })
    .then(response => {
      setClaims(response.data);
    })
    .catch(error => {
      console.error('There was an error fetching the claims!', error);
    });
  }, []);

  return (
    <div>
      <h1>Claims List</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Email</th>
            <th>Amount Claimed</th>
            <th>Policy Name</th>
            <th>Status</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {claims.map(claim => (
            <tr key={claim.id}>
              <td>{claim.id}</td>
              <td>{claim.userEmail}</td>
              <td>{claim.amountClaimed}</td>
              <td>{claim.policyName}</td>
              <td>{claim.status}</td>
              <td>
                <Link to={`/claim/${claim.id}`}>View</Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ClaimList;
